import React from 'react';
import styles from './Heading.module.scss';

const { container } = styles;

const Heading = () => {
  return (
    <div className={container}>
      <h3>Hi, I'm</h3>
      <h1>Sigrún Dís Hauksdóttir</h1>
      <h2>Software Developer</h2>
    </div>
  );
};

export default Heading;
